async function main() {
    let {tenant,start,historicalEnergy,historicalWater} = runtime.inputs();
    if (!(tenant || !tenant.tenantID) )throw 'Invalid tenant';
    let toDate = new Date(start);
    let fromDate = new Date(toDate);
    if (typeof historicalEnergy == 'string') {
        historicalEnergy = [];
    }
    if (typeof historicalWater == 'string') {
        historicalWater = [];
    }

    historicalEnergy = historicalEnergy || [];
    historicalWater = historicalWater || [];


    let he = JSON.stringify(historicalEnergy.map((x)=>({...x,time:new Date(x.time).toISOString()})));

    let hw = JSON.stringify(historicalWater.map((x)=>({...x,time:new Date(x.time).toISOString()})));
    fromDate.setMonth(toDate.getMonth()-1);

    let c = lucy.currentModel().collections();
    let item = await c.findOne('invoices',{tenant:tenant.tenantID},{sort:{end:-1}});
    let lastInvoiceDate = null;
    if (item) {
        lastInvoiceDate = item.end;
    }
    if (!lastInvoiceDate) {
        // use default fromDate
    } else {
        fromDate = new Date(lastInvoiceDate);
        //is this required?
        fromDate.setMilliseconds(fromDate.getMilliseconds()+1);
    }
    if (toDate < fromDate) {
        var error = 'The invoice end date is less than the start date';
        if (lastInvoiceDate) error =  'The invoice end date is before the last invoice end date ('+lastInvoiceDate+')';
        throw error;
    }
    let settings = await c.findOne('global',{},{});
    let template = settings.invoiceId;
    if (!template) throw 'No invoice template was configured';
    return {start:fromDate.toISOString(),end:toDate.toISOString(),
    energyTag:tenant.tenantID,
    waterTag:tenant.tenantID,
    parameters:{
        tenant:JSON.stringify(tenant),
        energy:he,
        water:hw,
        tenantID:tenant.tenantID,
        tenantName:tenant.tenantName,
        },
    template,
    }

}
